طريقة التحضير
قومي بخلط جميع المكونات مع بعضها جيداً بالمضرب الكهربائي.
أحضري صينية مستطيلة وافرشيها ورق زبدة وصبي فوقها الخليط.
سخني الفرن على درجة حرارة 180 وأدخلها الصينية للفرن لمدة 20 دقيقة.
أخرجي الصينية من الفرن وقطعي الكيك لنصفين.
أضيفي عليها الشوكولاتة وافرديها ثم لفيها روول وأدخليها الثلاجة لمدة ساعة.
أخرجي الكيك من الثلاجة وقطعيها وضعي فوقها صوص الشوكولاتة وزينيها بالفراولة.

